DROP TABLE IF EXISTS "tokyo_konbini" CASCADE;

CREATE TABLE "tokyo_konbini" 
( 
"ogc_fid" SERIAL NOT NULL PRIMARY KEY, 
"wkb_geometry" geometry,
"id" VARCHAR,
 "@id" VARCHAR,
"brand" VARCHAR,
"brand_en" VARCHAR,
"brand_ja" VARCHAR,
"name" VARCHAR,
"name_en" VARCHAR,
"name_ja" VARCHAR
);

CREATE INDEX "tokyo_konbini_wkb_geometry_geom_idx" ON "tokyo_konbini" USING GIST ("wkb_geometry");


